import React, { Component } from 'react';

class Bench extends Component {
    constructor(props) {
        super(props)
        this.state = {
            value: [],
        }
    }

    handleChange(e) {
        e.preventDefault();
        this.setState({
            value: e.target.value,
        })
    }   

    render() {
        return (
            <div>
                Bench: 
                <span>
                    <input onChange={this.handleChange}></input>
                </span>
                <div>{this.state.value}</div>
                <div>{this.state.value}</div>

            </div>
        )
    }
}

export default Bench
